Teaser:
Kör dina C/C++-program i ChATGPT med denna prompt. Detta är en mycket kraftfull uppmaning för att köra alla typer av kodningsspråk direkt i din webbläsare med Chatgpt.

 Skriv bara in din C- eller C++-kod du vill köra i prompten och Chat-GPT kommer att ge dig utdata från det programmet som svar.

 Detta är användbart om du inte har kompilatorn installerad på din PC och vill testa lite kod nu kan du göra det genom en enkel prompt.

 Exempel på C++-kod.
 #include <Istream>

 int main() {
  std::cout << "Hej chat-gpt3" << std::endl;
  returnera 0;
 }
